# Background

- College basketball has among the largest home court advantages in all of sports. 
- Student sections have been getting increasingly creative in their attempts to affect the outcome of opposing team shooters making their free throws.

# Previous Research

- [Duke medical student](https://www.dukechronicle.com/article/2023/11/duke-mens-basketball-free-throw-distractions-graduate-student-section) tabulated the miss percentage for games in the 2020-2021 and 2021-2022 seasons for various different distractions the graduate student section makes behind the basket in the second half.

![](images/clipboard-1490644583.png)

# Previous Research


![Duke's "Cameron Crazies"](images/clipboard-3722888607.png)

# Previous Research


- Arizona State is known for its "curtain of distraction" which rose to fame in 2015 and even had a surprise distraction of shirtless olympian Michael Phelps.

![](images/clipboard-2783188797.png)

# Previous Research


- The Harvard Sports Analytics Collective did a [study](https://harvardsportsanalysis.org/2015/02/how-distracting-is-asus-curtain-of-distraction/) in 2015 about the Arizona State "Curtain of Distraction"
- Reported that visiting teams shot 60.6% from the free-throw line in the second half compared to 68.6% in the first half. 
- Estimated it was worth approximately 1.41 points per game. 
- Not a statistically significant

# Previous Research

- Harvard PhD student and author of the `ncaahoopR` package, Luke Benz [revisited](https://lukebenz.com/post/asu_curtain/) the Arizona State distraction in 2019 and found that there was not enough evidence to conclude that teams shoot worse against Arizona State than they do at other *road* games.

# Data

- Data from the 2015-2016 college basketball season until the current season's data (2023-2024). 
- Home teams with less than 15 games in the dataset, grouped into one collective team.
- Only look at true road games, not neutral site. 

# Data

- Group all season's together for the home team when assessing a fan base/court effect
- But for the individual team shooting performances I treat each season separately

# Methodology

Two methods I explore:

1. Second Half vs First Half (shooting into a rowdy student section)
2. Overall effect of a home court on free throw percentage

## First Half vs Second

- Not every team may put a large student section behind the second half visiting team's basket
- Want to assess if there is an effect for teams
- Compare entire county to what we would expect due to randomness.

## First Half vs Second


- Only include teams with 200 free throws attempted at their home court in *both* the first half and second half in data set
- Results of **largest drop-off in free-throw percentage** from the 1st half to the 2nd half


