## First Half vs Second



- In fact, on average, visiting teams shoot 1 percent *better* in the second half than compared to the first.
- Could be due to the effect of the end of game scenarios in basketball.
  - If a team is winning and getting fouled it does its best to get the ball into the hands of their best free throw shooters.
- Hard to test this theory  
  - Would need to go with free throw share by players conditional on time remaining and score.
- I adjust p-values and z-scores by taking off an additional 1% of all 2nd half FT%

