## Full Game Effect Model


- College basketball has many teams in Division I with no stands behind the basket or no students.
- Can analyze general specific home court effect on visiting team's true ability in free-throw shooting percentage.


## Full Game Effect Model

- Samples sizes really are too small to do any player-level analysis
- Stick to team-level analysis
- A team's FT % in road game minus average FT % in home games

## Full Game Effect Model

What is a better comparison: 

- Free Throw Percentage at home games?
- Free Throw Percentage at other raod games?

## Full Game Effect Model

I used home games
 - More consistent data set (other road games have many different changing variables)
 - Power conference teams typically have may more home games than true road games.


## Full Game Effect Model


This model doesn't

- Account for travel to higher elevations (my  [previous work](https://www.espn.com/blog/statsinfo/post/_/id/130346/bracket-tips-from-the-basketball-power-index) at ESPN showed this to matter a lot)
- Day's rest for teams
- Distance traveled
- Individual player affects on FT% (assume this averages out over a season)

## Full Game Effect Model


My model can be defned as

\begin{align}
y_i &= \beta_0 + \gamma_j + \epsilon\\
\gamma_j &\sim Cauchy(0,1)\\
\epsilon & \sim N(0,\sigma^2)
\end{align}

- $y_i$ is the difference the visiting team's free throw percentage in game $i$ and its free throw percentage in al their home games that season. 
- $\gamma_j$ is the effect of the home team $j$'s 
- Weight the observations by the total number of free throw attempts in the game.

# Results

- Use posterior draws for the team effects to calculate the estimated effect a team's home court has on the opposing team's free throw percentage. 
- Calculate the posterior *probability* that a team's home court has an effect that decreases the probability of an opponent making a free throw. 


